import { register } from 'swiper/element/bundle';
import React from 'react';
// register Swiper custom elements
register();

function Slider() {
  return (
    <swiper-container id="mySwiper" slides-per-view="1" speed="1500" loop="true" css-mode="true">
      <swiper-slide lazy="true"><img src="../../img/slider/1.webp" alt="Slider 1" loading="lazy"/></swiper-slide>
      <swiper-slide lazy="true"><img src="../img/slider/2.webp" alt="Slider 2" loading="lazy"/></swiper-slide>
      <swiper-slide lazy="true"><img src="../img/slider/3.webp" alt="Slider 3" loading="lazy"/></swiper-slide>
      <swiper-slide lazy="true"><img src="../img/slider/3.webp" alt="Slider 4" loading="lazy"/></swiper-slide>
    </swiper-container>
  )
}

export default Slider;
